<item>
<title>2007-01-29 14:56:22</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ObshhieSvedenijaPoAMBS/show&amp;time=2007-01-29+14%3A56%3A22</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ObshhieSvedenijaPoAMBS&amp;amp;v=1l4" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Общие&amp;nbsp;Сведения&amp;nbsp;По&amp;nbsp;AMBS&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ObshhieSvedenijaPoAMBS&amp;amp;time=2007-01-29+14%3A56%3A22">2007-01-29 14:56:22&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ObshhieSvedenijaPoAMBS&amp;amp;time=2007-06-26+12%3A27%3A42">2007-06-26 12:27:42&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Данная система построена на&amp;nbsp;базе использовании браузера Internet Explorer. Изначально, система разрабатывалась для&amp;nbsp;транзитных операторов, но&amp;nbsp;впоследствии по&amp;nbsp;многочисленным заявкам наших клиентов были добавлены дополнительные модули, например, как&amp;nbsp;работа с&amp;nbsp;карточными платформами &lt;br />
В&amp;nbsp;этом разделе можно просмотреть детальную информацию по&amp;nbsp;звонкам и&amp;nbsp;по операторам за&amp;nbsp;любой период времен. Получить статистику звонков проходящих в&amp;nbsp;текущий момент времени, протестировать варианты доступных направлений по&amp;nbsp;конкретным номерам для&amp;nbsp;определенных операторов и&amp;nbsp;сравнить CDR-файлы.&lt;br />
Раздел для&amp;nbsp;ведения стран и&amp;nbsp;рабочих направлений. Просмотр, создание и&amp;nbsp;редактирование кодов стран, регионов и&amp;nbsp;городов. Добавление, редактирование и&amp;nbsp;удаление направлений. Установка фильтров на&amp;nbsp;определенное количество знаков в&amp;nbsp;номере по&amp;nbsp;конкретным направлениям. Также, форма “Trouble tickets” позволяет наглядно отслеживать статистику изменений параметров качества (ACD и&amp;nbsp;ASR) по&amp;nbsp;всем рабочим направлениям.&lt;br />
Раздел для&amp;nbsp;администрации AMBS системы. Здесь можно заводить и&amp;nbsp;редактировать группы пользователей, настройки и&amp;nbsp;права самих пользователей, а&amp;nbsp;также заполнять и&amp;nbsp;настраивать языковые словари системы.&lt;br />
Раздел для&amp;nbsp;работы с&amp;nbsp;карточными платформами. Здесь можно работать с&amp;nbsp;карточными лотами (создавать, редактировать) и&amp;nbsp;получать всевозможные типы статистики по&amp;nbsp;работе самих карточек.&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">Данная система построена на&amp;nbsp;базе использовании браузера Internet Explorer. Изначально, система разрабатывалась для&amp;nbsp;транзитных операторов, но&amp;nbsp;в последствии по&amp;nbsp;многочисленным заявкам наших клиентов были добавлены дополнительные модули, например, как&amp;nbsp;работа с&amp;nbsp;карточными платформами &lt;br />
В&amp;nbsp;этом разделе можно просмотреть детальную информация по&amp;nbsp;звонкам и&amp;nbsp;по операторам за&amp;nbsp;любой период времен. Получить статистику звонков проходящих в&amp;nbsp;текущий момент времени, протестировать варианты доступных направлений по&amp;nbsp;конкретным номерам для&amp;nbsp;определенных операторов и&amp;nbsp;сравнить CDR-файлы.&lt;br />
